import React, { Component } from 'react';
import Square from './Square.js';

class Test extends Component {
    render() {

        var cardStyle={
            height:200,
            width:150,

            backgroudColor:"#FFF",
            boxShadow: "0px 0px 5px #666",
            margin: "20px"

        };




        return (

            <div style={cardStyle}> 
               <Square />
            </div>

        );
    }
}

export default Test;
